export const patientName = (firstName: string, lastName: string) => {
  return firstName + ' ' + lastName;
};

export const sex = (sex: string) => {
  if (sex == 'F') {
    return 'Female';
  }
  if (sex == 'M') {
    return 'Male';
  } else return 'N/A';
};
